import React, { useEffect } from "react";
import io from "socket.io-client";

const App = () => {
  useEffect(() => {
    const socket = io("http://localhost:8000");

    // Handle socket events here

    return () => {
      socket.disconnect();
    };
  }, []);

  return <div>React App</div>;
};

export default App;
